import Head from 'next/head'
import { useState } from 'react'
import { FriendListWrapper } from './Friends.styles'

const Friends = () => {

    const [friends] = useState([
        {
            Name: 'Владислав',
            Surname: 'Самсонов',
            Photo: 'https://sun9-28.userapi.com/impg/1y_m2YWC85fh4zdlyq60cpztFfpcFPogzfdKnw/DIxREY8BCMM.jpg?size=810x1080&quality=96&sign=a7193cb8b0f274a7e9ad2ba08085db8c&type=album',
            id: 1
        },
        {
            Name: 'Александр',
            Surname: 'Иванов',
            Photo: 'https://sun9-11.userapi.com/impg/JMX3A1zVamMI0lhvojaB-0SI6-mrkJXHhNpRcQ/9yi0MswI468.jpg?size=720x1280&quality=95&sign=e76c5224e9039ff3c01e6d39cb6ffd41&type=album',
            id: 2
        },
        {
            Name
        }

    ])

    const createFriend = (name, surname, photo, id) => {
        return (
            {
                Name: name,
                Surname: surname,
                Photo: photo,
                id: id
            }
        )
    }

    const renderFriends = () => {
        return (
            <>
                <Head>
                    <title>Друзья</title>
                </Head>
                <>
                    {friends.map((friend) => (
                        <FriendListWrapper key={friend.id}>
                            <img src={friend.Photo} />
                            <h1>{`${friend.Name} ${friend.Surname}`}</h1>
                        </FriendListWrapper>
                    ))}
                </>
            </>
        )

    }
    
    return renderFriends()
}

export default Friends
